import React from 'react';

function SoundStageList({ soundStages }) {
  return (
    <ul>
      {soundStages.map((stage, index) => (
        <li key={index}>
          {/* Render the stage information here */}
          <div>Studio Name: {stage.studio_name}</div>
          <div>City: {stage.city}</div>
          <div>State: {stage.state}</div>
          {/* Add more information as needed */}
        </li>
      ))}
    </ul>
  );
}

export { SoundStageList };
